window.bookSummaryJSON = "<p>Trapped. Aker is playing a fully immersive virtual reality video game, called VampQuest, but he can’t quit and doesn’t remember his real life. </p> <p>He starts to raise level and enjoy the perks of being a vampire in a game-world mostly full of humans when a rival guild attacks. The battle leaves Aker bitter and bent on revenge. He completes many missions that take him far from his guild’s base but vows to return and bring peace when he is strong enough. </p> <p>Can Aker defeat his enemies? Will he ever escape from VampQuest?</p>"; 
